import React from "react";
import propTypes from "prop-types";

import * as Styled from "./style";

const Tr = ({ children }) => {
  return <Styled.Tr padding={padding}>{children}</Styled.Tr>;
};

Tr.propTypes = {
  children: propTypes.node.isRequired,
};

export default Tr;
